import React, { FC } from 'react'
import './profile_nav.css'

const NavItems = ['Tweets', 'Tweets & replies', 'Media', 'Likes']

export const ProfileNav: FC = () => {
  return (
    <nav className="wrp">
      <ul className="profile__nav">
        {NavItems.map((item) => (
          <li>{item}</li>
        ))}
      </ul>
    </nav>
  )
}

/*
        <li className="profile__items profile__nav--active">Tweets</li>
        <li className="profile__items">Tweets & replies</li>
        <li className="profile__items">Media</li>
        <li className="profile__items">Likes</li>
